import React, { useEffect, useState } from 'react';
import {
  Box,
  Typography,
  Paper,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  TextField,
  Button,
  Grid
} from '@mui/material';
import api from '../services/api';

// Helper format Rupiah
function formatRupiah(numStr) {
  if(!numStr) return "Rp 0";
  const num = parseFloat(numStr) || 0;
  return new Intl.NumberFormat('id-ID', {
    style:'currency',
    currency:'IDR'
  }).format(num);
}

// Helper parse number
function parseNumber(str){
  if(!str || str.trim() === "") return 0;
  return Number(str);
}

export default function Dividen() {
  const [data, setData] = useState([]);

  // State form input
  const [totalProfit, setTotalProfit] = useState('');
  const [notes, setNotes] = useState('');

  const fetchDividen = async()=>{
    try {
      const res = await api.get('/finance/dividen');
      setData(res.data);
    } catch(err){
      console.error(err);
      alert('Gagal memuat data Dividen');
    }
  };

  useEffect(()=>{
    fetchDividen();
  },[]);

  const handleSubmit = async(e)=>{
    e.preventDefault();
    try {
      // Pastikan numeric tidak string kosong
      const payload = {
        totalProfit: parseNumber(totalProfit),
        notes
        // status? => "PENDING" or "DONE" (tergantung logic di server)
      };

      await api.post('/finance/dividen', payload);
      setTotalProfit('');
      setNotes('');
      fetchDividen();
    } catch(err){
      console.error(err);
      alert('Gagal tambah dividen');
    }
  };

  return (
    <Box sx={{ p:2 }}>
      <Typography variant="h5" sx={{ fontWeight:700, mb:2 }}>
        Dividen Management
      </Typography>

      {/* FORM INPUT DIVIDEN */}
      <Paper sx={{ p:2, mb:3 }}>
        <Typography variant="subtitle1" sx={{ fontWeight:600, mb:1 }}>
          Tambah Dividen
        </Typography>
        <form onSubmit={handleSubmit}>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <TextField
                size="small"
                label="Total Profit (Rp)"
                type="number"
                fullWidth
                value={totalProfit}
                onChange={(e)=>setTotalProfit(e.target.value)}
                helperText="Nominal profit yang akan dibagikan"
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                size="small"
                label="Catatan"
                fullWidth
                value={notes}
                onChange={(e)=>setNotes(e.target.value)}
                helperText="Contoh: Dividen Q1 / catatan lain"
              />
            </Grid>
          </Grid>

          <Box sx={{ mt:2, textAlign:'right' }}>
            <Button variant="contained" type="submit">
              Simpan
            </Button>
          </Box>
        </form>
      </Paper>

      {/* TABEL LIST DIVIDEN */}
      <Paper sx={{ p:2 }}>
        <Table size="small">
          <TableHead>
            <TableRow sx={{ backgroundColor:'#f5f5f5' }}>
              <TableCell>ID</TableCell>
              <TableCell>Tanggal</TableCell>
              <TableCell>Total Profit (Rp)</TableCell>
              <TableCell>Catatan</TableCell>
              <TableCell>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((row)=>(
              <TableRow key={row.id}>
                <TableCell>{row.id}</TableCell>
                <TableCell>
                  { row.distributedAt 
                    ? new Date(row.distributedAt).toLocaleDateString() 
                    : '-'
                  }
                </TableCell>
                <TableCell>{formatRupiah(row.totalProfit)}</TableCell>
                <TableCell>{row.notes}</TableCell>
                <TableCell>{row.status || '-'}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Box>
  );
}
